MATCH (e:Employee)
WHERE e.id IN (
  SELECT DISTINCT employee_id
  FROM (
    MATCH (e:Employee)-[:PROMOTED_TO]->(other:Employee)
    UNION
    MATCH (e:Employee)-[:TRANSFERRED_TO]->(other:Employee)
  )
)
RETURN COUNT(DISTINCT e.id);

